import React from 'react';

function YearTabs() {
    return (
        <div className="flex justify-center">
            <button className="px-4 py-2 bg-gray-600 relative z-10 border text-gray-300 border-gray-400 hover:bg-gray-400 hover:text-gray-100">
                Freshman
            </button>
            <button className="px-4 py-2 bg-gray-600 relative z-10 border text-gray-300 border-gray-400 hover:bg-gray-400 hover:text-gray-100">
                Sophomore
            </button>
            <button className="px-4 py-2 bg-gray-600 relative z-10 border text-gray-300 border-gray-400 hover:bg-gray-400 hover:text-gray-100">
                Junior
            </button>
            <button className="px-4 py-2 bg-gray-600 relative z-10 border text-gray-300 border-gray-400 hover:bg-gray-400 hover:text-gray-100">
                Senior
            </button>
        </div>
    );
}

export default YearTabs;
